	function createUploadFolders(){
		$file = hikashop_get('class.file');
		$path = $file->getPath('file');
		if(!JFile::exists($path.'.htaccess')){
			$text = 'deny from all';
			JFile::write($path.'.htaccess',$text);
		}
		$path = $file->getPath('image');
	}


